// page1.js
import React from "react";

function Page1() {

    const goToPage2 = () => {
        history.push("/about");
    };

    return (
        <div>
            <h1>Hello here is page1</h1>
            <button onClick={goToPage2}>Go to Page 2</button>
        </div>
    );
}

export default Page1;
